// src/Component/Timeline.js
import React, { useEffect, useState } from 'react';
import Card from './Card';
import './Timeline.css';
import axios from 'axios';

const sampleData=[
    {
        username: "nithish",
        userPost: "Hi this is Nithish First Post",
        likes: 2,
        disLikes: 3,
        _id: "66409a0e0d84c167f48ba00f"
    },
    {
        username: "nithish",
        userPost: "Hi this is Nithish Second Post",
        likes: 4,
        disLikes: 1,
        _id: "66409a0e0d84c167f48ba010"
    }
];

const Timeline=() => {
    const [post, setPost]=useState( [] )
    useEffect( () => {

        const cardData=async () => {
            try {
                const response=await axios.get( 'http://localhost:5000/friend/all' )
                console.log( response )
                setPost( response.data )
            } catch ( error ) {
                console.log( 'Error while Fetching request , error' )
            }

        }
        cardData();
    }, [] )
    return (
        <div className='card-container'>
            {sampleData.map( post => (
                <Card
                    key={post._id}
                    username={post.username}
                    userPost={post.userPost}
                    likes={post.likes}
                    disLikes={post.disLikes}
                />
            ) )}
        </div>
    );
};

export default Timeline;
